pragma solidity ^0.8.9;

import {ERC721Upgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import {ERC721BurnableUpgradeable} from "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721BurnableUpgradeable.sol";
import {AccessControlUpgradeable} from "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import {Initializable} from "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import {CountersUpgradeable} from "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import {UUPSUpgradeable} from "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

import {Levels} from "./libraries/Levels.sol";
import {IKinetexRewards} from "./IKinetexRewards.sol";

contract KinetexRewards is
    IKinetexRewards,
    Initializable,
    ERC721Upgradeable,
    ERC721BurnableUpgradeable,
    AccessControlUpgradeable,
    UUPSUpgradeable
{
    using CountersUpgradeable for CountersUpgradeable.Counter;

    CountersUpgradeable.Counter private _tokenIdCounter;

    bytes32 public constant MINTER_ROLE = keccak256(abi.encodePacked("MINTER_ROLE"));
    bytes32 public constant BURNER_ROLE = keccak256(abi.encodePacked("BURNER_ROLE"));
    string public baseURI;
    string public contractMetadataURI;

    mapping(uint256 => Attributes) internal _attributesByTokenId;

    uint256[96] private __gap;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize() public initializer {
        __ERC721_init("Kinetex Rewards", "KTXR");
        __ERC721Burnable_init();
        __AccessControl_init();

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _grantRole(BURNER_ROLE, msg.sender);
    }

    function safeMint(address to, uint256 dust) public onlyRole(MINTER_ROLE) {
        uint256 tokenId = _tokenIdCounter.current();
        Levels.Level level = Levels.getLevelByDustAmount(dust);

        _attributesByTokenId[tokenId] = Attributes(level, dust);

        _tokenIdCounter.increment();
        _safeMint(to, tokenId);

        emit Mint(tokenId, Attributes(level, dust));
    }

    function burn(uint256 tokenId) public override(ERC721BurnableUpgradeable, IKinetexRewards) {
        delete _attributesByTokenId[tokenId];
        super.burn(tokenId);
        emit Burn(tokenId);
    }

    function burnPriveleged(uint256 tokenId) external onlyRole(BURNER_ROLE) {
        delete _attributesByTokenId[tokenId];
        _burn(tokenId);
        emit Burn(tokenId);
    }

    function setBaseURI(string calldata uri) external onlyRole(DEFAULT_ADMIN_ROLE) {
        baseURI = uri;
        emit SetBaseURI(uri);
    }

    function setContractURI(string calldata uri) external onlyRole(DEFAULT_ADMIN_ROLE) {
        contractMetadataURI = uri;
        emit SetContractURI(uri);
    }

    function getDust(uint256 tokenId) external view returns (uint256) {
        return _attributesByTokenId[tokenId].dust;
    }

    function getAttributes(uint256 tokenId) external view returns (Attributes memory) {
        return _attributesByTokenId[tokenId];
    }

    function getNextTokenId() external view returns (uint256) {
        return _tokenIdCounter.current();
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721Upgradeable, AccessControlUpgradeable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function contractURI() external view returns (string memory) {
        return contractMetadataURI;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function _authorizeUpgrade(address newImplementation)
        internal
        override
        onlyRole(DEFAULT_ADMIN_ROLE)
    {}
}
","keccak256":"0x510f91a67ac645ebeb4ba4f0bfeca5eaebf23d59c14c9c44c0057971b7430559","license":"MIT"},"contracts/libraries/Levels.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

library Levels {
    enum Level {
        DUST,
        GEM,
        CRYSTAL,
        LIGHTNING
    }

    function getLevelByDustAmount(uint256 dust) internal pure returns (Level) {
        if (dust < 10) {
            return Level.DUST;
        }

        if (dust < 100) {
            return Level.GEM;
        }

        if (dust < 1000) {
            return Level.CRYSTAL;
        }

        return Level.LIGHTNING;
    }

    function _getDustPercentage(Level level, uint256 months)
        internal
        pure
        returns (uint256 dustPercentage)
    {
        if (level == Level.DUST) {
            if (months >= 12) {
                return 100;
            }
            if (months >= 6) {
                return 60;
            }
            if (months >= 3) {
                return 30;
            }
            if (months >= 1) {
                return 10;
            }

            return 0;
        }

        if (level == Level.GEM) {
            if (months >= 10) {
                return 100;
            }
            if (months >= 6) {
                return 60;
            }
            if (months >= 3) {
                return 40;
            }
            if (months >= 1) {
                return 20;
            }

            return 0;
        }

        if (level == Level.CRYSTAL) {
            if (months >= 8) {
                return 100;
            }
            if (months >= 6) {
                return 70;
            }
            if (months >= 3) {
                return 50;
            }
            if (months >= 1) {
                return 30;
            }

            return 0;
        }

        if (months >= 6) {
            return 100;
        }
        if (months >= 5) {
            return 80;
        }
        if (months >= 3) {
            return 60;
        }
        if (months >= 1) {
            return 40;
        }

        return 0;
    }
}
